// src/components/product/wizard/Pantalla9Resumen.tsx

import { jsPDF } from "jspdf";
import BarcodeImage from "../widgets/BarcodeImage";
import { QRCodeCanvas } from "qrcode.react";

// Opcional: aquí puedes poner tu logo en base64 si lo tienes.
// Por ahora lo dejamos vacío y se imprimirá solo el texto.
// Si después quieres, te ayudo a convertir tu logo a dataURL.
const LOGO_DATA_URL = ""; // "data:image/png;base64,...."

type ResumenProps = {
  producto: any;
  proyecto: string;         // <-- agregar
  clienteNombre: string;
};

function ResumenRow({
  label,
  value,
}: {
  label: string;
  value?: any;
}) {
  if (!value) return null;

  return (
    <div className="flex justify-between gap-4 py-1">
      <span className="text-tertiary text-sm">{label}</span>
      <span className="text-gray-800 dark:text-white text-sm font-medium text-right">
        {value}
      </span>
    </div>
  );
}


export default function Pantalla9Resumen({ producto, clienteNombre }: ResumenProps) {
  if (!producto) return null;

  const hasValue = (v: any) =>
  v !== null && v !== undefined && String(v).trim() !== "";
  // === Agrupación por categorías ===
  const secciones = [
    {
      id: "general",
      titulo: "Información general",
      icono: "📋",
      items: [
        { label: "Cliente", value: clienteNombre },
        { label: "Ubicación", value: producto.ubicacion },
        { label: "Área / Sector", value: producto.area_sector },
        { label: "Piso / Nivel", value: producto.piso },
        { label: "Categoría", value: producto.tipo },
        { label: "Descripción corta", value: producto.descripcion_corta },
        { label: "Descripción larga", value: producto.descripcion_larga },
        { label: "Etiqueta nueva", value: producto.tag_nuevo },
        { label: "Etiqueta anterior", value: producto.tag_anterior },
        { label: "País de origen", value: producto.pais_origen },
        { label: "Año", value: producto.ano },
        { label: "Material", value: producto.material },
      ],
    },
    {
      id: "dimensiones",
      titulo: "Dimensiones y capacidades",
      icono: "📐",
      items: [
        { label: "Largo (cm)", value: producto.largo },
        { label: "Ancho (cm)", value: producto.ancho },
        { label: "Alto (cm)", value: producto.alto },
        { label: "Capacidad", value: producto.capacidad },
        { label: "Volumen", value: producto.volumen },
        { label: "Peso", value: producto.peso },
      ],
    },
    {
      id: "asignacion",
      titulo: "Asignación",
      icono: "👤",
      items: [
        { label: "Responsable", value: producto.responsable },
        { label: "Usuario asignado", value: producto.usuario },
        { label: "Área asignada", value: producto.asignacion_area },
        { label: "Departamento", value: producto.asignacion_departamento },
      ],
    },
    {
      id: "identificacion",
      titulo: "Identificación",
      icono: "🆔",
      items: [
        { label: "Código de barras", value: producto.codigo_barras },
        { label: "Código QR", value: producto.codigo_qr },
      ],
    },
  ];

  const tieneObservaciones = producto.observaciones || producto.notas_adicionales;
  const tieneImagenes = producto.imagenes && producto.imagenes.length > 0;
  const tieneCodigos = producto.codigo_barras || producto.codigo_qr;

  // === Generar PDF corporativo con jsPDF ===
  const handleDownloadPdf = () => {
    const doc = new jsPDF({
      orientation: "portrait",
      unit: "mm",
      format: "a4",
    });

    const pageWidth = doc.internal.pageSize.getWidth();
    const pageHeight = doc.internal.pageSize.getHeight();
    let y = 15;

    // Encabezado con logo + empresa
    if (LOGO_DATA_URL) {
      try {
        const logoWidth = 26;
        const logoHeight = 26;
        doc.addImage(LOGO_DATA_URL, "PNG", 10, 10, logoWidth, logoHeight);

        doc.setFont("helvetica", "bold");
        doc.setFontSize(14);
        doc.text("Anzaval Consulting", 10 + logoWidth + 5, 18);

        doc.setFont("helvetica", "normal");
        doc.setFontSize(10);
        doc.text("Sistema de Gestión de Activos", 10 + logoWidth + 5, 24);
      } catch (e) {
        // Si falla el logo, seguimos solo con texto
        doc.setFont("helvetica", "bold");
        doc.setFontSize(16);
        doc.text("Anzaval Consulting", 10, 18);
        doc.setFont("helvetica", "normal");
        doc.setFontSize(10);
        doc.text("Sistema de Gestión de Activos", 10, 24);
      }
    } else {
      doc.setFont("helvetica", "bold");
      doc.setFontSize(16);
      doc.text("Anzaval Consulting", 10, 18);
      doc.setFont("helvetica", "normal");
      doc.setFontSize(10);
      doc.text("Sistema de Gestión de Activos", 10, 24);
    }

    // Fecha y cliente
    const fecha = new Date().toLocaleDateString();
    doc.setFont("helvetica", "normal");
    doc.setFontSize(9);
    doc.text(`Fecha: ${fecha}`, pageWidth - 10, 12, { align: "right" });
    if (clienteNombre) {
      doc.text(`Cliente: ${clienteNombre}`, pageWidth - 10, 17, { align: "right" });
    }

    // Línea divisoria
    doc.setDrawColor(180);
    doc.line(10, 30, pageWidth - 10, 30);

    y = 38;

    // Helper: salto de página si nos acercamos al final
    const ensureSpace = (extra: number) => {
      if (y + extra > pageHeight - 15) {
        doc.addPage();
        y = 15;
      }
    };

    // Helper: escribir título de sección
    const writeSectionTitle = (titulo: string) => {
      ensureSpace(10);
      doc.setFont("helvetica", "bold");
      doc.setFontSize(12);
      doc.text(titulo, 10, y);
      y += 6;
      doc.setDrawColor(210);
      doc.setLineWidth(0.3);
      doc.line(10, y, pageWidth - 10, y);
      y += 4;
      doc.setFont("helvetica", "normal");
      doc.setFontSize(10);
    };

    // Helper: escribir línea label: valor
    const writeField = (label: string, value: any) => {
      if (value === undefined || value === null || value === "") return;
      const text = `${label}: ${String(value)}`;
      const split = doc.splitTextToSize(text, pageWidth - 20);
      ensureSpace(split.length * 5 + 4);
      doc.text(split, 10, y);
      y += split.length * 5 + 2;
    };

    // Secciones principales
    secciones.forEach((sec) => {
      const visibles = sec.items.filter(
        (it) => it.value !== undefined && it.value !== null && it.value !== ""
      );
      if (visibles.length === 0) return;
      writeSectionTitle(sec.titulo);
      visibles.forEach((item) => writeField(item.label, item.value));
      y += 3;
    });

    // Observaciones
    if (tieneObservaciones) {
      writeSectionTitle("Observaciones");
      if (producto.observaciones) {
        writeField("Observaciones", producto.observaciones);
      }
      if (producto.notas_adicionales) {
        writeField("Notas adicionales", producto.notas_adicionales);
      }
    }

    // Códigos (solo texto por ahora; imágenes sería un siguiente nivel)
    if (tieneCodigos) {
      writeSectionTitle("Códigos del activo");
      writeField("Código de barras", producto.codigo_barras);
      writeField("Código QR", producto.codigo_qr);
    }

    // Pie de página
    doc.setFont("helvetica", "normal");
    doc.setFontSize(8);
    const footerText1 = "Anzaval Consulting – Sistema de Gestión de Activos";
    const footerText2 = "https://www.anzaval.com";
    doc.setTextColor(120);
    doc.text(footerText1, pageWidth / 2, pageHeight - 10, { align: "center" });
    doc.text(footerText2, pageWidth / 2, pageHeight - 5, { align: "center" });

    const fileName =
      (producto.descripcion_corta || "activo") + "_resumen.pdf";

    doc.save(fileName.replace(/\s+/g, "_"));
  };

  // === Imprimir (versión imprimible del navegador) ===
  const handlePrint = () => {
    window.print();
  };

  return (
    <div className="flex flex-col space-y-8 px-2 md:px-0 pb-10 print:bg-white print:text-black">

      {/* =================== HEADER / ACCIONES =================== */}
      <div className="flex flex-col sm:flex-row sm:items-center sm:justify-between gap-3 print:flex-row print:items-center print:justify-between">
        <div>
          <h2 className="text-xl font-semibold text-blue-300 print:text-black">
            Resumen del activo
          </h2>
          {producto.descripcion_corta && (
            <p className="text-sm text-white/60 mt-1 print:text-black">
              {producto.descripcion_corta}
            </p>
          )}
        </div>

        <div className="flex flex-col sm:flex-row gap-2 print:hidden">
          <button
            type="button"
            onClick={handleDownloadPdf}
            className="px-4 py-2 rounded-xl bg-blue-600 hover:bg-blue-700 text-white text-sm font-semibold"
          >
            📄 Descargar / Compartir PDF
          </button>

          <button
            type="button"
            onClick={handlePrint}
            className="px-4 py-2 rounded-xl bg-white/10 hover:bg-white/20 text-white text-sm font-semibold border border-white/20"
          >
            🖨️ Versión imprimible
          </button>
        </div>
      </div>

      {/* =================== SECCIONES (GENERAL, DIMENSIONES, ASIGNACIÓN, IDENTIFICACIÓN) =================== */}
      {secciones.map((sec) => {
        const visibles = sec.items.filter(
          (it) => it.value !== undefined && it.value !== null && it.value !== ""
        );
        if (visibles.length === 0) return null;

        return (
          <section key={sec.id} className="space-y-3">
            <h3 className="text-lg text-white/80 font-semibold flex items-center gap-2 print:text-black">
              <span className="text-xl">{sec.icono}</span>
              <span>{sec.titulo}</span>
            </h3>

            <div className="flex flex-col divide-y divide-white/10 rounded-xl overflow-hidden border border-white/10 bg-white/5 print:border-gray-300 print:bg-white print:divide-gray-200">
              {visibles.map((item, idx) => (
                <div
                  key={idx}
                  className="flex flex-col px-4 py-3 text-[15px] leading-tight"
                >
                  <span className="text-white/40 text-xs uppercase tracking-wide mb-1 print:text-gray-500">
                    {item.label}
                  </span>
                  <span className="text-white break-words print:text-black">
                    {String(item.value)}
                  </span>
                </div>
              ))}
            </div>
          </section>
        );
      })}

      {/* =================== OBSERVACIONES =================== */}
      {tieneObservaciones && (
        <section className="space-y-3">
          <h3 className="text-lg text-white/80 font-semibold flex items-center gap-2 print:text-black">
            <span className="text-xl">📝</span>
            <span>Observaciones</span>
          </h3>

          {producto.observaciones && (
            <div className="p-4 rounded-xl bg-white/5 border border-white/10 text-white text-[15px] leading-relaxed print:bg-white print:text-black print:border-gray-300">
              {producto.observaciones}
            </div>
          )}

          {producto.notas_adicionales && (
            <div className="p-4 rounded-xl bg-white/5 border border-white/10 text-white text-[15px] leading-relaxed print:bg-white print:text-black print:border-gray-300">
              {producto.notas_adicionales}
            </div>
          )}
        </section>
      )}

      {/* ===================== AUDITORÍA / MIGRACIÓN ===================== */}
{[
  producto.tag_anterior,
  producto.tag_colocado_nuevo,
  producto.usuario,
  producto.consultor,
  producto.area_especifica,
  producto.descripcion_larga,
  producto.notas_adicionales,
  producto.observaciones,
].some(hasValue) && (
  <div className="card-base space-y-2">
    <h3 className="section-title text-blue-500">
      🧾 Auditoría / Migración
    </h3>

    <ResumenRow label="Etiqueta anterior" value={producto.tag_anterior} />
    <ResumenRow label="Etiqueta colocada nueva" value={producto.tag_colocado_nuevo} />
    <ResumenRow label="Usuario" value={producto.usuario} />
    <ResumenRow label="Consultor" value={producto.consultor} />
    <ResumenRow label="Área específica" value={producto.area_especifica} />
    <ResumenRow label="Descripción larga" value={producto.descripcion_larga} />
    <ResumenRow label="Notas adicionales" value={producto.notas_adicionales} />
    <ResumenRow label="Observaciones" value={producto.observaciones} />
  </div>
)}



      {/* =================== CÓDIGOS (QR / BARRAS) =================== */}
      {tieneCodigos && (
        <section className="space-y-4">
          <h3 className="text-lg text-white/80 font-semibold flex items-center gap-2 print:text-black">
            <span className="text-xl">🏷️</span>
            <span>Códigos del activo</span>
          </h3>

          <div className="flex flex-col md:flex-row gap-4 md:items-start">
            {producto.codigo_barras && (
              <div className="flex-1 flex flex-col items-center space-y-2 p-4 rounded-xl bg-white/5 border border-white/10 print:bg-white print:border-gray-300">
                <p className="text-xs uppercase tracking-wide text-white/50 print:text-gray-500">
                  Código de barras
                </p>
                <BarcodeImage value={producto.codigo_barras} />
                <p className="text-xs text-white/60 break-words print:text-black">
                  {producto.codigo_barras}
                </p>
              </div>
            )}

            {producto.codigo_qr && (
              <div className="flex-1 flex flex-col items-center space-y-2 p-4 rounded-xl bg-white/5 border border-white/10 print:bg-white print:border-gray-300">
                <p className="text-xs uppercase tracking-wide text-white/50 print:text-gray-500">
                  Código QR
                </p>
                <div className="p-2 rounded-2xl bg-[#020617] border border-white/15 print:border-gray-300 print:bg-white">
                  <QRCodeCanvas
                    value={producto.codigo_qr || ""}
                    size={140}
                    bgColor="#020617"
                    fgColor="#ffffff"
                  />
                </div>
                <p className="text-xs text-white/60 break-words text-center print:text-black">
                  {producto.codigo_qr}
                </p>
              </div>
            )}
          </div>
        </section>
      )}

      {/* =================== IMÁGENES =================== */}
      {tieneImagenes && (
        <section className="space-y-3">
          <h3 className="text-lg text-white/80 font-semibold flex items-center gap-2 print:text-black">
            <span className="text-xl">🖼️</span>
            <span>Imágenes</span>
          </h3>

          <div className="grid grid-cols-2 md:grid-cols-3 gap-3">
            {producto.imagenes.map((img: any) => (
              <div
                key={img.id}
                className="relative aspect-square overflow-hidden rounded-xl bg-white/10 border border-white/10 print:border-gray-300"
              >
                <img
                  src={img.url}
                  alt="Imagen del activo"
                  className="w-full h-full object-cover"
                />
              </div>
            ))}
          </div>
        </section>
      )}
      
    </div>
  );
}
